function App() {
  return (
    <div className="App" id={theme}>
      <NavBar />
      <Routes>
        <Route index element={<Home/>}/>
        <Route path={"/home"} element={<Home/>}/>
        <Route path={"/experience"} element={<Experience/>}/>
        <Route path={"/projects"} element={<Projects/>}/>
        <Route path={"/contact"} element={<Contact/>}/>
      </Routes>
    </div>
  );
}

export default App;
